import * as services from "../services/personelServices";
import { useState, useEffect } from "react";

export default function PersonalPage() {
  const [personalList, setPersonalList] = useState();

  useEffect(() => {
    if (!personalList) {
      services.getPersonel().then((res) => setPersonalList(res.payload));
    }
  }, [personalList]);

  return (
    <table>
      <tr>
        <th>Personel Adı</th>
        <th>Personel Soyadı</th>
        <th>Personel TC</th>
      </tr>

      {personalList?.map((item) => (
        <tr>
          <td>{e?.personelName}</td>
          <td>{e?.personelSurname}</td>
          <td>{e?.personelTc}</td>
        </tr>
      ))}
    </table>
  );
}
